( '2021000005', '2021000001', 'Profil Pimpinan', '<b>PIMPINAN</b>
<br />
Terdiri dari 1 orang ketua, didampingi 3 orang wakil ketua 
<br />
Ketua &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : Hanung Raharjo, ST- Fraksi PDIP 
<br />
Wakil ketua &nbsp;&nbsp;: 
<br />
<ul>
	<li>Nur Subiyantoro, SI.Kom- Fraksi Gerindra</li>
	<li>Subhan Nawwawi - Fraksi PKB</li>
	<li>Damba Aktivis - Fraksi PAN</li>
</ul>

<b>TUGAS PIMPINAN</b>
<br />
Pimpinan DPRD Mempunyai Tugas :
<ol>
	<li>Memimpin sidang-sidang dan menyimpulkan hasil sidang untuk mengambil keputusan</li>
	<li>Menyusun rencana kerja dan mengadakan pembagian kerja antara Ketua dan Wakil Ketua</li>
	<li>Menjadi juru bicara DPRD</li>
	<li>Melaksanakan dan memasyarakatkan keputusan DPRD</li>
	<li>Mengadakan konsultasi dengan Bupati dan instansi Pemerintah lainnya sesuai dengan Keputusan DPRD</li>
	<li>Mewakili DPRD dan atau alat kelengkapan DPRD, di Pengadilan</li>
	<li>Melaksanakan keputusan DPRD berkenaan dengan penetapan sanksi atau rehabilitasi Anggota sesuai dengan ketentuan peraturan perundang-undangan dan</li>
	<li>Mempertanggungjawabkan pelaksanaan tugasnya dalam Rapat Paripurna DPRD</li>
</ol>	', NULL, '0', 'yes', NULL, 'catur', '2021-11-07 18:39:09', '2111050001' ),
( '2021000007', '2021000002', 'Agenda Raperda', '<p>Agenda Raperda</p><p><img style="width: 25%;" src="											http://localhost/bantul/dinas/dprd/aspirasi/applications/jarimas-dprd-bantul/resource/doc/files/pages/2021000007/211104215602bg_depan.jpg										"></p><p><iframe src="//www.youtube.com/embed/2gdD_8K8jQI" class="note-video-clip" width="640" height="360" frameborder="0"></iframe><br></p>', NULL, '1', 'no', NULL, 'catur', '2021-11-07 19:31:23', '2111050001' ),
( '2021000008', '2021000002', 'Agenda Raperda Tahunan', '<p>Agenda Raperda Tahunan<br></p>', NULL, '0', 'no', NULL, 'catur', '2021-11-07 19:31:35', '2111050001' ),
( '2021000009', '2021000002', 'Kegiatan', '<p>Kegiatan<br></p>', NULL, '0', 'no', NULL, 'catur', '2021-11-07 19:31:47', '2111050001' ),
( '2021000010', '2021000001', 'Gambaran Umum', '<p>
DPRD Kabupaten Bantul masa bakti 2019-2024 diambil sumpah dan janjinya pada tanggal 13 Agustus 2019. Sejumlah 45 Caleg terpilih resmi disahkan menjadi anggota DPRD melalui Rapat Paripurna istimewa tersebut, adapun komposisi anggota berdasarkan partai politik adalah sebagai berikut.
</p>
<ol style="margin-top: -15px;">
	<li>Partai Demokrasi Indonesia Perjuangan : 11 Anggota</li>
	<li>Partai Gerakan Indonesia Raya : 8 Anggota</li>
	<li>Partai Amanat Nasional : 5 Anggota</li>
	<li>Partai Golongan Karya : 5 Anggota</li>
	<li>Partai Kebangkitan Bangsa : 6 Anggota</li>
	<li>Partai Keadilan Sejahtera : 4 Anggota</li>
	<li>Partai Persatuan Pembangunan : 2 Anggota</li>
	<li>Partai Nasional Demokrat : 1 Anggota</li>
	<li>Partai Bulan dan Bintang : 1 Anggota</li>
	<li>Partai Demokrat : 2 Anggota</li>
</ol>
<p style="margin-top: 25px;">
Dari 10 Partai Politik yang memiliki kursi di DPRD Kabupaten Bantul, terbentuk 7 fraksi yaitu:
</p>
<ol style="margin-top: -15px;">
	<li>Fraksi PDI Perjuangan</li>
    <li>Fraksi Gerindra</li>
    <li>Fraksi Amanat Nasional</li>
    <li>Fraksi Golkar</li>
    <li>Fraksi Kebangkitan Bangsa</li>
    <li>Fraksi Keadilan Sejahtera</li>
    <li>Fraksi Persatuan Demokrat yang merupakan gabungan Partai Nasional Demokrat, Partai Bulan Bintang dan Partai Persatuan Pembangunan</li>
</ol>
<p style="margin-top: 25px;">
Dalam rangka melaksanakan dan fungsinya DPRD kabupaten Bantul dilengkapi dengan alat kelembagaan berupa :
</p>
<ul style="margin-top: -15px;">
    <li>Pimpinan Dewan terdiri dari 4 orang</li>
    <li>Komisi-Komisi ( A, B, C, D )</li>
    <li>Badan Musyawarah</li>
    <li>Badan Anggaran</li>
    <li>Badan Legislasi</li>
    <li>Badan Kehormatan</li>
</ul>
<p style="margin-top: 25px;">
Dari alat kelembagaan yang ada dan bersifat tetap DPRD juga didukung alat kelembagaan yang tidak tetap yang biasanya berbentuk : Panitia Khusus (PANSUS).
</p>
', NULL, '0', 'yes', NULL, 'jarud', '2021-11-08 09:00:40', '1910210001' ),
( '2021000011', '2021000001', 'Badan Kehormatan', '<p>Berdasarkan Surat Keputusan DPRD Bantul No.  Tahun 2019 tentang Pembentukan Badan Kehormatan DPRD Masa Jabatan 2019-2024. 									
</p>
<table style="background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; margin-bottom: 1.25rem; border: 1px solid rgb(221, 221, 221); table-layout: auto;" cellspacing="0" cellpadding="0" border="1">
	<tbody>
		<tr>
