<p>
TUGAS BADAN LEGISLASI DPRD
<ol style="margin-top: -20px;">
	<li>Menyusun rancangan program legislasi daerah yang memuat daftar urutan dan prioritas rancangan Peraturan Daerah beserta alasannya untuk setiap tahun anggaran di lingkungan DPRD.</li>
	<li>Koordinasi untuk penyusunan program legislasi daerah antara DPRD dan Pemerintah Daerah.</li>
	<li>Menyiapkan rancangan Peraturan Daerah usul DPRD berdasarkan program prioritas yang telah ditetapkan.</li>
	<li>Melakukan pengharmonisasian, pembulatan, dan pemantapan konsepsi rancangan Peraturan Daerah yang diajukan Anggota, komisi dan/atau gabungan komisi sebelum rancangan Peraturan Daerah tersebut disampaikan kepada Pimpinan DPRD.</li>
	<li>Memberikan pertimbangan terhadap rancangan Peraturan Daerah yang diajukan oleh Anggota, komisi dan/atau gabungan komisi, di luar prioritas rancangan Peraturan Daerah tahun berjalan atau di luar rancangan Peraturan Daerah yang terdaftar dalam program legislasi daerah.</li>
	<li>Mengikuti perkembangan dan melakukan evaluasi terhadap pembahasan materi muatan rancangan Peraturan Daerah melalui koordinasi dengan komisi dan/atau panitia khusus.</li>
	<li>Melakukan inventarisasi dan evaluasi terhadap produk hukum yang telah ditetapkan.</li>
	<li>Memberikan masukan kepada Pimpinan DPRD atas rancangan Peraturan Daerah yang ditugaskan oleh Badan Musyawarah.</li>
	<li>Membuat laporan kinerja dan inventarisasi masalah di bidang perundang-undangan pada akhir masa keanggotaan DPRD.</li>
</ol>
</p>
