( '2021000018', '2021000001', 'Profil Komisi', '
<b>TUGAS, SUSUNAN, PERSONALIA dan PEMBIDANGAN TUGAS KOMISI-KOMISI DPRD PERIODE 2019-2024</b>
<p>
Komisi merupakan alat kelengkapan DPRD yang bersifat tetap dan dibentuk oleh DPRD pada awal masa jabatan keanggotaan DPRD. 
<br />
Komisi-komisi DPRD Kabupaten Bantul terdiri dari : 
<br />
Tugas Komisi-Komisi DPRD:
<ol style="margin-top: -15px;">
	<li>Mempertahankan dan memelihara kerukunan nasional serta keutuhan Negara Kesatuan Republik Indonesia dan Daerah</li>
	<li>Melakukan pembahasan terhadap rancangan Peraturan Daerah, dan Rancangan Keputusan DPRD</li>
	<li>Melakukan pengawasan terhadap pelaksanaan pembangunan, pemerintahan, dan kemasyarakatan sesuai dengan bidang komisi masing-masing</li>
	<li>Membantu Pimpinan DPRD untuk mengupayakan penyelesaian masalah yang disampaikan oleh Bupati dan masyarakat kepada DPRD</li>
	<li>Menerima, menampung dan membahas serta menindaklanjuti aspirasi masyarakat</li>
	<li>Memperhatikan upaya peningkatan kesejahteraan rakyat di Daerah</li>
	<li>Melakukan kunjungan kerja Komisi yang bersangkutan atas persetujuan Pimpinan DPRD</li>
	<li>Mengadakan rapat kerja dan dengar pendapat</li>
	<li>Mengajukan usul kepada Pimpinan DPRD yang termasuk dalam ruang lingkup bidang tugas masing-masing Komisi</li>
	<li>Memberikan laporan tertulis kepada Pimpinan DPRD tentang hasil pelaksanaan tugas Komisi</li>
</ol>
</p>

<p style="margin-top: 25px;">
Berdasarkan Surat Keputusan DPRD Bantul No. Tahun 2019 tentang Pembentukan Komisi-komisi DPRD Bantul masa jabatan 2019-2024, terbentuk 4 komisi yaitu Komisi A, Komisi B, Komisi C dan Komisi D. Adapun keanggotaan dan komposisi Pimpinan Komisi adalah sebagai berikut:
<br/>
KOMISI A
<br />
Jumlah personalia 9 orang, dengan komposisi pimpinan
<br />
Ketua &ensp;&ensp;&ensp;&ensp;&ensp;&ensp;&ensp; : Muhammad Agussalim  (F-PKB)
<br />
Wakil Ketua&ensp;&ensp;: Suratun,SH. ( F PAN)
<br />
Sekretaris &ensp;&ensp;&ensp; : Jumakir( F Persatuan Demokrat)
<br />
Anggota &ensp;&ensp;&ensp;&ensp; :
<ol style="margin-top: -20px;">
	<li>Drs.Pambudi Mulya,M.Si (F.PDI)</li>
	<li>Anton Wahono, S.Sos  (F. PDIP)</li>
	<li>Sukardiyono, SH ( F Gerindra)</li>
	<li>Novi Sarhati,  (F.Gerindra)</li>
	<li>Teguh Santosa SE  (F. Partai Golkar)</li>
	<li>Sigit Nursyam Priyanto,S.Si (F PKS)</li>
</ol>
</p>
<p style="margin-top: -15px;">
Bidang tugas Komisi A :
<br />
Bidang Hukum, Pemerintahan, Pertanahan, Ketertiban masyarakat, Penerangan/Pers, Kepegawaian, Sosial Politik, Umum, Sekretariat DPRD dan Pemberdayaan Masyarakat
</p>

KOMISI B
<br />
Jumlah personalia 10 orang, dengan komposisi pimpinan
<br />
Ketua &ensp;&ensp;&ensp;&ensp;&ensp;&ensp;&ensp; : Wildan Nafis,SE (F.PAN)
<br />
Wakil Ketua&ensp;&ensp;: Aryunadi,SE ( F.PDIP)
<br />
Sekretaris &ensp;&ensp;&ensp; : Mahmudin,S.P.( F.PKB)
<br />
Anggota &ensp;&ensp;&ensp;&ensp; :
<ol style="margin-top: 0px;">
	<li>Nur Yuni Astuti,S.Sos,SH  (F.PDI)</li>
	<li>Jumirin (F. GERINDRA)</li>
	<li>Saryanto (F. GERINDRA)</li>
	<li>H.Heru Sudibyo,S.Sos,MM (F. PGolkar)</li>
	<li>Arif Haryanto,S.SI (F. PKS)</li>
	<li>Edi Prabowo,SE ( F Persatuan Demokrat)</li>
	<li>H.Bibit Rustamta,SH ( F Persatuan Demokrat)</li>
</ol>
<p style="margin-top: -15px;">
Bidang tugas Komisi B:
<br />
Pertanian, Perikanan, Peternakan, Perkebunan, Kehutanan, Ketahanan Pangan, Keuangan & Aset Daerah, Perpajakan, Retribusi, Perbankan, Perusahaan Daerah/Patungan, Penanaman Modal, Pariwisata, Seni, Kebudayaan, Perindustrian, Perdagangan, Koperasi, & Perekonomian 
</p>

KOMISI C
<br />
Jumlah personalia 10 orang, dengan komposisi pimpinan
<br />
Ketua &ensp;&ensp;&ensp;&ensp;&ensp;&ensp;&ensp; : Dwi Kristiantoro,ST ( F PDIP) 
<br />
Wakil Ketua&ensp;&ensp;: Datin Wisnu Pranyoto ( F Gerindra) 
