	<li>H. Suryono (F. GOLKAR)</li>
	<li>Hj.Arni Tyas Palupi,ST (F. Golkar)</li>
	<li>Muhammad Dhavid, S.Pt.(PKS)</li>
	<li>Rony Wijaya Indra Gunawan (F Persatuan Demokrat)</li>
	<li>Johan Munandar (F.KB)</li>
</ol>
<p style="margin-top: -15px;">
Bidang tugas Komisi C:
<br />
Bidang Pekerjaan Umum, Tata Kota, Pertamanan, Kebersihan, Pertambangan & Energi, Perumahan Rakyat, Lingkungan Hidup, Perencanaan Pembangunan, Pengairan dan Perhubungan 
</p>


KOMISI D
<br />
Jumlah personalia 11 orang, dengan komposisi pimpinan
