	<li>H.Ichwan Tamrin Murdiyanto,SE(F. PAN)</li>
	<li>Paidi, SIP (F.PGolkar)</li>
	<li>Drs.Ahmad Agus Sofwan,M.Pd.I (PKS)</li>
	<li>Eko Sutrisno Aji (F.Persatuan Demokrat)</li>
	<li>Drs.Supriyono,M.Si (F.Persatuan Demokrat)</li>
</ol>
<p style="margin-top: -15px;">
Bidang tugas Komisi D:
<br />
Bidang Pendidikan, Kesehatan, Kesejahteraan Rakyat, Sosial, Kepemudaan, Olah Raga, Peranan Wanita, Keluarga Berencana, Agama, Tenaga Kerja dan Transmigrasi. 
</p>									
