( '58', 'publik', 'informasi', 'Ketentuan Pengguna', '<h5><strong>KETENTUAN PENGGUNAAN APLIKASI BANTULPEDIA</strong></h5>

<h6><strong>MULAI 1 JUNI 2021</strong></h6>

<p> </p>

<p><strong>BACALAH SELURUH KETENTUAN PENGGUNAAN INI SEBELUM MENGAKSES ATAU MENGGUNAKAN APLIKASI BANTULPEDIA.</strong></p>

<p> </p>

<h6><strong>1.   Ketentuan Umum.</strong></h6>

<p>Ketentuan Penggunaan ini adalah perjanjian antara pengguna <strong>(“Anda”)</strong> dan Pemerintah Kabupaten Bantul <strong>(“Kami”)</strong>. Ketentuan Penggunaan ini mengatur akses dan penggunaan Anda atas aplikasi, situs web <a href="https://bantulpedia.bantulkab.go.id" target="_blank"> bantulpedia.bantulkab.go.id </a> dan/atau situs web lain yang Kami kelola, konten yang disediakan oleh Kami, selanjutnya secara bersama-sama disebut sebagai <strong>(“Aplikasi”)</strong>, serta penggunaan layanan yang tersedia pada Aplikasi <strong>(“Layanan”)</strong>.</p>

<p>Dengan menyetujui Ketentuan Penggunaan ini, Anda juga menyetujui Ketentuan Penggunaan tambahan, termasuk Ketentuan Penggunaan pada setiap Layanan, dan/atau perubahannya yang merupakan bagian yang tidak terpisahkan dari Ketentuan Penggunaan ini, selanjutnya, Ketentuan Penggunaan, Ketentuan Penggunaan tambahan, dan/atau perubahannya secara bersama-sama disebut sebagai <strong>(“Ketentuan Penggunaan”)</strong>. Meskipun merupakan satu kesatuan, Ketentuan Penggunaan tambahan akan berlaku dalam hal terdapat perbedaan dengan Ketentuan Penggunaan.</p>

<h6><strong>2.   Ketentuan Umum.</strong></h6>

<p>Akses dan penggunaan Aplikasi tunduk pada Ketentuan Penggunaan ini.</p>

<p>Anda mempunyai kebebasan penuh untuk memilih menggunakan Aplikasi dan/atau aplikasi lain, menggunakan Layanan yang tersedia pada Aplikasi atau tidak, dan/atau berhenti menggunakan Aplikasi.</p>

<h6><strong>3.   Pembukaan dan Pengaksesan Akun Bantulpedia.</strong></h6>

<p>Sebelum menggunakan Aplikasi, Anda harus menyetujui Ketentuan Penggunaan ini dan <a href="https://bantulpedia.bantulkab.go.id/kebijakanprivasi.html" target="_blank"> Kebijakan Privasi</a>, serta mendaftarkan diri Anda dengan memberikan informasi yang dibutuhkan oleh Kami. Saat melakukan pendaftaran, Kami akan meminta Anda untuk memberikan nomor induk kependudukan dan alamat e-mail pribadi Anda yang sah.</p>

<p>Dalam hal Anda telah keluar dari Akun Anda, maka Anda perlu memasukan nomor induk kependudukan atau alamat e-mail dan kata sandi (password) yang ada berikan pada saat mendaftarkan diri Anda.</p>

<p><strong>Fitur Otentikasi Perangkat.</strong></p>

<p>Saat anda menggunakan Aplikasi kami dan mengaktifkan fitur sidik jari (<em>fingerprint</em>) dan/atau pengenalan wajah (<em>facial recognition</em>) di perangkat seluler anda untuk keperluan autentikasi, harap dicatat bahwa kami tidak menyimpan data biometrik tersebut. Kecuali diberitahukan lain kepada anda, data tersebut tersimpan di perangkat seluler anda dan/atau dapat disimpan oleh pihak ketiga, seperti pembuat perangkat anda. Anda setuju dan mengakui bahwa kami tidak bertanggung jawab atas setiap akses tidak sah atau kerugian apapun atas data biometrik yang tersimpan di perangkat seluler anda.</p>

<h6><strong>4.   Akun Bantulpedia Anda.</strong></h6>

<p>Akun Anda hanya dapat digunakan oleh Anda dan tidak bisa dialihkan kepada orang lain dengan alasan apapun. Keamanan dan kerahasiaan Akun Anda tunduk pada peraturan perundang-undangan yang berlaku. Kami memberlakukan upaya terbaik untuk melindungi dan mengamankan data dan Informasi Pribadi anda dari akses, pengumpulan, penggunaan dan/atau pengungkapan oleh orang-orang yang tidak berwenang dan/atau dari pengolahan yang bertentangan dengan hukum, kehilangan yang tidak disengaja, pemusnahan, dan/atau kerusakan dan/atau risiko serupa.</p>

<p>Keamanan dan/atau kerahasiaan Akun Anda, termasuk nama lengkap terdaftar, nomor induk kependudukan terdaftar, dan alamat e-mail terdaftar sepenuhnya merupakan tanggung jawab pribadi Anda. Semua kerugian dan risiko yang ada akibat kelalaian Anda menjaga keamanan dan/atau kerahasiaan sebagaimana disebutkan ditanggung oleh Anda sendiri. Dalam hal demikian, Kami akan menganggap setiap penggunaan yang dilakukan melalui Akun Anda sebagai permintaan yang sah dari Anda.</p>

<p>Segera beritahukan Kami jika Anda mengetahui atau menduga bahwa Akun Anda telah digunakan tanpa sepengetahuan dan/atau persetujuan Anda. Kami akan melakukan tindakan yang Kami anggap perlu dan/atau dapat Kami lakukan terhadap penggunaan tanpa persetujuan tersebut.</p>

<h6><strong>5.   Informasi Pribadi.</strong></h6>

<p>Pihak lain penyedia konten yang bekerja sama dengan Kami <strong>(“Penyedia Konten Pihak Ketiga”)</strong>, dapat menyediakan konten yang dapat Anda temukan pada Aplikasi <strong>(“Konten Pihak Ketiga”)</strong>. Dalam hal Konten Pihak Ketiga disediakan oleh Penyedia Konten Pihak Ketiga, Kami tidak bertanggung jawab atas bagian apapun dari isi Konten Pihak Ketiga tersebut. Akses dan/atau penggunaan Anda terhadap Konten Pihak Ketiga tersebut merupakan bentuk persetujuan Anda untuk tunduk pada syarat dan ketentuan yang ditetapkan oleh Kami dan/atau Penyedia Konten Pihak Ketiga, termasuk terhadap <a href="https://bantulpedia.bantulkab.go.id/kebijakanprivasi.html" target="_blank"> Kebijakan Privasi</a> Kami atau Penyedia Konten Pihak Ketiga.</p>

<p><strong>Konten Pihak Ketiga</strong> termasuk, tetapi tidak terbatas pada setiap dan/atau seluruh informasi, yang dibuat dan/atau disusun dan/atau dikembangkan dan/atau dikelola oleh Penyedia Konten Pihak Ketiga termasuk namun tidak terbatas pada teks atau tulisan, gambar, kutipan (<em>quotes</em>), foto, ilustrasi, animasi, video, rekaman suara dan/atau musik, judul, deskripsi dan/atau setiap data dalam bentuk apapun yang disediakan oleh Penyedia Konten Pihak Ketiga untuk ditampilkan pada Aplikasi, termasuk setiap tautan yang menghubungkan kepadanya. Untuk menghindari keraguan, Konten Pihak Ketiga termasuk, tetapi tidak terbatas pada setiap dan/atau seluruh informasi, data, berita aktual, tulisan, gambar, kutipan, foto, ilustrasi, animasi, video, dan/atau rekaman suara, yang diperoleh Penyedia Konten Pihak Ketiga dari pihak ketiga, dimana Penyedia Konten Pihak Ketiga telah memiliki kewenangan untuk menggunakan dan mendistribusikan konten tersebut.</p>

<p>Kami dan/atau pihak lain yang bekerja sama dengan Kami dapat memberikan Layanan dan/atau manfaat lain terkait dengan penggunaan Aplikasi.</p>

<p>Semua informasi yang terdapat pada Aplikasi hanya dimaksudkan untuk memberikan Anda pengalaman terbaik ketika menggunakan Aplikasi. Anda tidak boleh menyalahgunakannya selama penggunaan Aplikasi.</p>

<h6><strong>6.   Biaya dan Pendaftaran.</strong></h6>

<p>Pengunduhan perangkat lunak dan/atau penggunaan Aplikasi adalah bebas biaya.</p>

<h6><strong>7.   Perangkat Lunak Aplikasi.</strong></h6>

<p>Kami hanya menyediakan perangkat lunak Aplikasi yang resmi pada pasar digital resmi, seperti <a href="https://play.google.com/store/apps/details?id=id.go.bantulkab.bantulpedia" target="_blank"><em>Google Play Store</em></a> dan/atau <a href="https://apps.apple.com/id/app/bantulpedia/id1579902635" target="_blank"><em>Apple App Store</em></a>, dan untuk digunakan hanya pada perangkat telepon genggam dan/atau tablet. Mengunduh Aplikasi dari tempat lain selain pasar digital resmi dan/atau kedalam perangkat lain selain telepon genggam dan/atau tablet merupakan pelanggaran terhadap Ketentuan Penggunaan ini dan/atau terhadap hak kekayaan intelektual Kami.</p>

<h6><strong>8.   Kekayaan Intelektual.</strong></h6>

<p>Aplikasi dan/atau Layanan termasuk, tetapi tidak terbatas pada setiap dan/atau seluruh nama, logo, kode program, desain, merek dagang, teknologi, basis data, proses dan/atau model bisnis, dilindungi oleh hak cipta, merek, paten dan/atau hak kekayaan intelektual lainnya yang tersedia berdasarkan hukum Republik Indonesia yang terdaftar baik atas nama Kami ataupun afiliasi Kami. Kami (dan pemberi lisensi Kami) memiliki seluruh hak dan/atau kepentingan atas Aplikasi dan/atau Layanan, termasuk seluruh hak kekayaan intelektual terkait dengan seluruh fitur yang terdapat di dalamnya dan/atau hak kekayaan intelektual terkait.</p>

<p>Tunduk pada Ketentuan Penggunaan ini, Kami memberikan Anda lisensi terbatas yang tidak eksklusif, dapat ditarik kembali, tidak dapat dialihkan (tanpa hak sublisensi) untuk: 1) Mengunduh, mengakses, dan/atau menggunakan Aplikasi, sebagaimana adanya, hanya pada perangkat berupa telepon genggam dan/atau tablet pribadi Anda dan/atau hanya untuk keperluan terkait penggunaan Aplikasi dan/atau Layanan, dan 2) Mengakses dan/atau menggunakan konten, informasi dan/atau materi terkait yang tersedia pada Aplikasi hanya untuk kepentingan pribadi dan/atau bukan tujuan komersial. Hak dan/atau hak istimewa lainnya yang tidak secara tegas diberikan dalam Ketentuan Penggunaan ini, adalah hak Kami dan/atau pemberi lisensi Kami.</p>

<p>Setiap penggandaan, distribusi, pembuatan karya turunan, penjualan dan/atau penawaran untuk menjual, menampilkan baik sebagian dan/atau seluruhnya, serta penggunaan Aplikasi dan/atau Layanan, baik secara digital dan/atau lainnya dan/atau pada perangkat selain telepon genggam dan/atau tablet, termasuk, tetapi tidak terbatas pada setiap dan/atau seluruh penggunaan aplikasi tambahan seperti aplikasi modifikasi, emulator, dan lain-lain, yang menyimpang dari Ketentuan Penggunaan ini, maupun tujuan penggunaan yang ditentukan oleh Kami, merupakan pelanggaran terhadap hak kekayaan intelektual Kami.</p>

<p>Anda tidak boleh:</p>

<ol>
 <li>menghapus setiap pemberitahuan hak cipta, merek dagang dan/atau pemberitahuan hak milik lainnya yang terkandung dalam Aplikasi;</li>
 <li>menyalin, memodifikasi, mengadaptasi, menerjemahkan, membuat karya turunan, mendistribusikan, memberikan lisensi, menjual, mengalihkan, menampilkan di muka umum baik sebagian maupun seluruhnya, merekayasa balik (<em>reverse engineer</em>), mentransmisikan, memindahkan, menyiarkan, menguraikan, dan/atau membongkar bagian manapun dari dan/atau dengan cara lain mengeksploitasi Aplikasi (termasuk perangkat lunak, fitur dan/atau Layanan di dalamnya);</li>
 <li>memberikan lisensi, mensublisensikan, menjual, menjual kembali, memindahkan, mengalihkan, mendistribusikan dan/atau mengeksploitasi secara komersial dan/atau membuat tersedia kepada pihak lain Aplikasi dan/atau perangkat lunak dengan cara menciptakan tautan (<em>link</em>) internet ke Aplikasi atau "<em>frame</em>" dan/atau "<em>mirror</em>" setiap perangkat lunak pada server lain dan/atau perangkat nirkabel dan/atau yang berbasis internet;</li>
 <li>meluncurkan program otomatis dan/atau script, termasuk, tetapi tidak terbatas pada setiap dan/atau seluruh <em>web spiders</em>, <em>web crawlers</em>, <em>web robots</em>, <em>web ants</em>, <em>web indexers</em>, <em>bots</em>, virus dan/atau <em>worm</em>, dan/atau program apapun yang mungkin membuat beberapa permintaan server per detik, menciptakan beban berat dan/atau menghambat operasi dan/atau kinerja Aplikasi;</li>
 <li>menggunakan aplikasi pencarian dan/atau pengambilan kembali situs, perangkat manual dan/atau otomatis lainnya untuk mengambil (<em>scraping</em>), indeks (<em>indexing</em>), survei (<em>surveying</em>), tambang data (<em>data mining</em>), dan/atau dengan cara apapun memperbanyak dan/atau menghindari struktur navigasi dan/atau presentasi dari Aplikasi dan/atau isinya;</li>
 <li>menerbitkan, mendistribusikan dan/atau memperbanyak dengan cara apapun terhadap materi yang dilindungi hak cipta, merek dagang, dan/atau informasi lain yang Kami miliki tanpa persetujuan tertulis terlebih dahulu dari Kami dan/atau pemilik hak yang melisensikan hak-nya kepada Kami, dan/atau</li>
 <li>menggunakan dan/atau mengakses secara tidak resmi Aplikasi untuk: 1) Merusak, melemahkan dan/atau membahayakan setiap aspek dari Aplikasi, Layanan dan/atau sistem dan/atau jaringan terkait; dan 2) Membuat Aplikasi dan/atau Layanan tandingan serupa menggunakan ide, fitur, fungsi dan/atau grafik menyerupai Aplikasi.</li>
</ol>

<h6><strong>9.   Tanggung Jawab Anda.</strong></h6>

<p>Anda bertanggung jawab penuh atas keputusan yang Anda buat untuk menggunakan dan/atau mengakses Aplikasi, Layanan, dan/atau Konten Pihak Ketiga.</p>

<p>Anda bertanggung jawab secara penuh atas setiap kerugian dan/atau klaim yang timbul dari penggunaan Aplikasi, Layanan, dan/atau Konten Pihak Ketiga, baik oleh Anda dan/atau pihak lain yang menggunakan Akun Anda, dengan cara yang bertentangan dengan Ketentuan Penggunaan ini, <a href="https://bantulpedia.bantulkab.go.id/kebijakanprivasi.html" target="_blank"> Kebijakan Privasi</a>, termasuk syarat dan ketentuan dan/atau kebijakan privasi yang ditentukan oleh Penyedia Konten Pihak Ketiga dan/atau peraturan perundang-undangan yang berlaku termasuk, tetapi tidak terbatas pada setiap dan/atau seluruh tujuan anti pencucian uang, anti pendanaan terorisme, aktivitas kriminal, penipuan dalam bentuk apapun (termasuk, tetapi tidak terbatas pada setiap dan/atau seluruh kegiatan <em>phishing</em> dan/atau <em>social engineering</em>), pelanggaran hak kekayaan intelektual, dan/atau aktivitas lain yang merugikan publik dan/atau pihak lain manapun dan/atau yang dapat atau dianggap dapat merusak reputasi Kami.</p>

<h6><strong>10. Batasan Tanggung Jawab Kami.</strong></h6>

<p>Kami menyediakan Aplikasi sebagaimana adanya dan Kami tidak menyatakan atau menjamin bahwa keandalan, ketepatan waktu, kualitas, kesesuaian, ketersediaan, akurasi, kelengkapan dan/atau keamanan dari Aplikasi dapat memenuhi kebutuhan dan/atau akan sesuai dengan harapan Anda termasuk, tetapi tidak terbatas pada setiap dan/atau seluruh Layanan dan/atau Konten Pihak Ketiga (yang sepenuhnya menjadi tanggung jawab Penyedia Konten Pihak Ketiga). Kami tidak bertanggung jawab atas setiap kerugian dan/atau kerusakan yang disebabkan oleh setiap kegagalan dan/atau kesalahan yang dilakukan oleh Penyedia Konten Pihak Ketiga ataupun kegagalan dan/atau kesalahan Anda dalam mematuhi Ketentuan Penggunaan Kami dan/atau Penyedia Konten Pihak Ketiga.</p>

<p>Aplikasi dapat mengalami keterbatasan, penundaan, dan/atau masalah-masalah lain yang terdapat dalam penggunaan internet dan/atau komunikasi elektronik, termasuk perangkat Anda, Penyedia Konten Pihak Ketiga, tidak terhubung dengan internet, berada di luar jangkauan, dimatikan dan/atau tidak berfungsi. Kami tidak bertanggung jawab atas kerugian yang diakibatkan oleh masalah-masalah tersebut.</p>

<p>Kami tidak berkewajiban untuk mengawasi akses dan/atau penggunaan Anda atas Aplikasi. Namun, Kami tetap melakukan pengawasan untuk tujuan memastikan kelancaran penggunaan Aplikasi dan/atau untuk memastikan kepatuhan terhadap Ketentuan Penggunaan ini, kebijakan Pemerintah, peraturan dan/atau peraturan perundang-undangan yang berlaku.</p>

<p>Kami tidak mempunyai kewajiban apapun, termasuk untuk mengambil tindakan lebih jauh dan/atau tindakan hukum yang dianggap perlu oleh Anda dan/atau Penyedia Konten Pihak Ketiga terhadap setiap permasalahan dan/atau perselisihan yang timbul antara Anda dan Penyedia Konten Pihak Ketiga. Tetapi, Kami akan memfasilitasi setiap permasalahan atau perselisihan yang timbul antara Anda dan Penyedia Konten Pihak Ketiga, dengan upaya wajar yang diperlukan. Ketika Kami memfasilitasi penyelesaian permasalahan dan/atau perselisihan antara Anda dan Penyedia Konten Pihak Ketiga. Kami tidak bertindak sebagai mediator dan hal tersebut tidak menimbulkan kewajiban lebih jauh apapun terhadap Kami.</p>

<h6><strong>11. Kekayaan Intelektual.</strong></h6>

<p>Apabila Anda mengalami gangguan sistem, mengetahui dan/atau menduga bahwa Akun Anda diretas, digunakan dan/atau disalahgunakan oleh pihak lain, dan/atau apabila perangkat telepon genggam dan/atau tablet pribadi Anda hilang, dicuri, diretas dan/atau terkena virus, segera laporkan kepada Kami sehingga Kami dapat segera mengambil tindakan yang diperlukan untuk menghindari penggunaan, penyalahgunaan, dan/atau kerugian yang timbul atau mungkin timbul lebih lanjut.</p>

<p>Apabila Anda mengalami kendala dan/atau masalah terkait Layanan dan/atau Konten Pihak Ketiga, Anda dapat menyampaikan keluhan Anda melalui fitur yang Kami sediakan, termasuk pemberian peringkat dan/atau komentar.</p>

<p>Untuk menyampaikan keluhan, pertanyaan, sanggahan, dan lain-lain <strong>(“Laporan”)</strong>, Anda perlu memberikan informasi yang cukup termasuk, tetapi tidak terbatas pada setiap dan/atau seluruh ringkasan fakta yang terjadi, bukti-bukti yang Anda miliki, dan/atau informasi pribadi, seperti alamat e-mail terdaftar.</p>

<p>Untuk menanggapi setiap Laporan yang Anda sampaikan, Kami akan melakukan verifikasi terlebih dahulu dengan mencocokan informasi yang Anda berikan dan/atau informasi pribadi Anda yang terdapat dalam sistem Kami. Jika diperlukan, Kami dapat secara langsung meminta Anda memberikan informasi yang diperlukan untuk tujuan verifikasi.</p>

<p>Kami dapat menolak untuk menindaklanjuti Laporan Anda jika informasi yang Anda berikan tidak cocok dengan informasi pribadi yang terdapat dalam sistem Kami dan/atau apabila Laporan disampaikan terkait, terhadap, atas nama dan/atau oleh pihak lain yang berbeda dengan pemilik Akun yang bersangkutan yang terdaftar secara resmi pada sistem Kami. Kami dapat memberhentikan tindak lanjut terhadap Laporan Anda jika Kami, dengan kebijakan Kami sepenuhnya, menganggap bahwa Laporan Anda tidak didukung oleh fakta-fakta yang cukup dan jelas, dan/atau telah selesai. Kami juga dapat meneruskan Laporan Anda kepada Penyedia Konten Pihak Ketiga.</p>

<p>Terhadap Laporan tertentu terkait Layanan, Kami dapat, dengan kebijakan Kami sepenuhnya, memfasilitasi pertemuan antara Anda dan Penyedia Konten Pihak Ketiga untuk tujuan penyelesaian masalah secara damai dan kekeluargaan. Dalam hal demikian, jika Anda merasa tetap perlu mengambil tindakan lain, termasuk tindakan hukum apapun, Anda dapat melakukannya atas tanggung jawab pribadi Anda sepenuhnya.</p>

<h6><strong>12. Pembekuan Sementara dan Pembekuan Permanen Akun Bantulpedia.</strong></h6>

