 <li>Sistem Kami mendeteksi adanya tindakan yang tidak wajar dari penggunaan Akun Anda dan/atau adanya kewajiban berdasarkan Ketentuan Penggunaan, <a href="https://bantulpedia.bantulkab.go.id/kebijakanprivasi.html" target="_blank"> Kebijakan Privasi</a>, kebijakan Pemerintah, peraturan dan/atau peraturan perundang-undangan yang berlaku yang tidak dipenuhi oleh Anda;</li>
 <li>Anda telah meninggal dunia, ditempatkan dibawah perwalian atau pengampuan dan/atau mengalami ketidakmampuan lainnya yang menjadikan Anda tidak cakap hukum berdasarkan peraturan perundang-undangan yang berlaku;</li>
 <li>Penggunaan Aplikasi dan/atau Layanan oleh Anda dan/atau pihak lain (yang menggunakan Akun Anda) dengan cara yang bertentangan dengan Ketentuan Penggunaan, <a href="https://bantulpedia.bantulkab.go.id/kebijakanprivasi.html" target="_blank"> Kebijakan Privasi</a>, kebijakan Pemerintah, peraturan dan/atau peraturan perundang-undangan yang berlaku; dan/atau</li>
