<p>Jika Akun Anda dibekukan dan Anda memiliki bukti yang jelas bahwa Akun Anda seharusnya tidak dibekukan, Anda dapat membuat Laporan kepada Kami untuk menyampaikan bukti-bukti tersebut. Setelah melakukan pemeriksaan lebih lanjut terhadap Laporan Anda, Kami akan, atas kebijakan Kami sepenuhnya, menentukan untuk mengakhiri atau melanjutkan pembekuan terhadap Akun Anda. Pembekuan tidak akan diteruskan secara tidak wajar apabila Kami memutuskan bahwa hal-hal yang mengakibatkan terjadinya pembekuan telah diselesaikan.</p>

<p>Anda tidak akan menggunakan Aplikasi pada perangkat dan/atau sistem operasi yang telah dimodifikasi diluar perangkat, konfigurasi sistem operasi dan/atau konfigurasi Aplikasi. Hal ini mencakup perangkat yang telah melalui proses <em>“rooted”</em> dan/atau <em>“jail-broken”</em>. Perangkat <em>“rooted”</em> dan/atau <em>“jail-broken”</em> adalah perangkat yang telah dibebaskan dari pembatasan yang dikenakan oleh penyedia layanan perangkat dan/atau yang dimanufaktur tanpa persetujuan penyedia layanan perangkat. Penggunaan Aplikasi pada perangkat <em>“rooted”</em> dan/atau <em>“jail-broken”</em> dapat mengkompromisasi keamanan.</p>

<p>Kami tidak bertanggung jawab atas pengunduhan dan/atau penggunaan Aplikasi pada perangkat <em>“rooted”</em> dan/atau <em>“jail-broken”</em> dan resiko penggunaan anda terhadap perangkat <em>“rooted”</em> dan/atau <em>“jail-broken”</em> sepenuhnya adalah resiko anda. Anda mengerti dan setuju bahwa Kami tidak bertanggung jawab atas segala kehilangan dan/atau setiap konsekuensi lain yang diderita dan/atau disebabkan oleh anda sebagai akibat dari penggunaan Aplikasi pada perangkat <em>“rooted”</em> dan/atau <em>“jail-broken”</em> dan Kami mempunyai diskresi untuk menghentikan penggunaan Anda terhadap Aplikasi pada perangkat <em>“rooted”</em> dan/atau <em>“jail-broken”</em> dan memblokir perangkat <em>“rooted”</em> dan/atau <em>“jail-broken”</em> untuk menggunakan Aplikasi.</p>

