<p>Anda setuju untuk mengakses dan/atau menggunakan Aplikasi hanya untuk tujuan sebagaimana ditentukan dalam Ketentuan Penggunaan ini dan/atau tidak menyalahgunakan dan/atau menggunakan Aplikasi untuk tujuan pelanggaran terhadap kebijakan Pemerintah, peraturan dan/atau peraturan perundang-undangan yang berlaku.</p>

