<p>Aplikasi dapat diinterupsi oleh kejadian di luar kewenangan dan/atau kontrol Kami <strong>(“Keadaan Kahar”)</strong> termasuk, tetapi tidak terbatas pada setiap dan/atau seluruh bencana alam, gangguan listrik, gangguan telekomunikasi, kebijakan Pemerintah, peraturan dan/atau peraturan perundang-undangan yang berlaku, dan lain-lain. Anda setuju untuk membebaskan Kami dari setiap tuntutan dan tanggung jawab baik sebagian maupun seluruhnya, karena suatu Keadaan Kahar.</p>

<h6><strong>16. Lain-Lain.</strong></h6>

<p>Anda mengerti dan setuju bahwa Ketentuan Penggunaan ini merupakan perjanjian dalam bentuk elektronik dan tindakan Anda menekan tombol ‘daftar’ saat pembukaan Akun atau tombol ‘masuk’ saat akan mengakses Akun Anda merupakan persetujuan aktif Anda untuk mengikatkan diri dalam perjanjian dengan Kami sehingga keberlakuan Ketentuan Penggunaan ini dan <a href="https://bantulpedia.bantulkab.go.id/kebijakanprivasi.html" target="_blank"> Kebijakan Privasi</a> adalah sah dan mengikat secara hukum dan terus berlaku sepanjang penggunaan Aplikasi oleh Anda.</p>

<p>Anda tidak akan mengajukan tuntutan dan/atau keberatan apapun terhadap keabsahan dari Ketentuan Penggunaan dan/atau <a href="https://bantulpedia.bantulkab.go.id/kebijakanprivasi.html" target="_blank"> Kebijakan Privasi</a> yang dibuat dalam bentuk elektronik.</p>

<p>Anda tidak dapat mengalihkan hak Anda berdasarkan Ketentuan Penggunaan ini tanpa persetujuan tertulis sebelumnya dari Kami. Namun, Kami dapat mengalihkan hak Kami berdasarkan Ketentuan Penggunaan ini setiap saat kepada pihak lain tanpa perlu mendapatkan persetujuan terlebih dahulu dari dan/atau memberikan pemberitahuan sebelumnya kepada Anda.</p>

<p>Bila Anda tidak mematuhi dan/atau melanggar ketentuan dalam Ketentuan Penggunaan ini, dan Kami tidak mengambil tindakan secara langsung, bukan berarti Kami mengesampingkan hak Kami untuk mengambil tindakan yang diperlukan di kemudian hari.</p>

<p>Ketentuan ini tetap berlaku bahkan setelah pembekuan sementara, pembekuan permanen, penghapusan Aplikasi dan/atau setelah berakhirnya perjanjian ini antara Anda dan Kami.</p>

<p>Jika salah satu dari ketentuan dalam Ketentuan Penggunaan ini tidak dapat diberlakukan, hal tersebut tidak akan memengaruhi ketentuan lainnya.</p>

<p>Kami membuat Ketentuan Penggunaan ini dalam bahasa Indonesia.</p>

<p>Ketentuan Penggunaan ini diatur berdasarkan hukum Republik Indonesia. Setiap dan/atau seluruh perselisihan yang timbul dari penggunaan Aplikasi dan/atau Layanan tunduk pada yurisdiksi eksklusif Pengadilan Negeri Bantul.</p>

<h6><strong>17. Cara Menghubungi Kami.</strong></h6>

<p>Jika anda memiliki pertanyaan mengenai Ketentuan Penggunaan dan/atau keluhan lainnya silahkan menghubungi <a href="mailto:bantulpedia@bantulkab.go.id">bantulpedia@bantulkab.go.id</a>. Semua korespondensi Anda akan dicatat, direkam dan disimpan untuk arsip Kami.</p>

<h6><em><strong>Saya telah membaca dan mengerti seluruh Ketentuan Penggunaan ini beserta konsekuensinya dan dengan ini menerima setiap hak, kewajiban, dan ketentuan yang diatur didalamnya.</strong></em></h6>', NULL, '2105060001', '2021-09-14 13:57:41' ),
( '59', 'publik', 'informasi', 'Kebijakan Privasi', '<h5>KEBIJAKAN PRIVASI APLIKASI BANTULPEDIA</h5>

<h6>MULAI 1 JUNI 2021</h6>

<p> </p>

<p>Kebijakan Privasi berikut ini menjelaskan bagaimana kami, Pemerintah Kabupaten Bantul <strong>(“Kami”)</strong> mengumpulkan, menyimpan, menggunakan, mengolah, menguasai, mentransfer, mengungkapkan dan/atau melindungi Informasi Pribadi anda. Kebijakan Privasi ini berlaku bagi seluruh pengguna aplikasi, situs web <a href="https://bantulpedia.bantulkab.go.id" target="_blank">bantulpedia.bantulkab.go.id</a> dan/atau situs web lain yang Kami kelola, konten yang disediakan oleh Kami, selanjutnya secara bersama-sama disebut sebagai <strong>(“Aplikasi”)</strong>, serta penggunaan layanan yang tersedia pada Aplikasi <strong>(“Layanan”)</strong>, kecuali diatur pada kebijakan privasi yang terpisah.</p>

<p> </p>

<p><strong>Mohon untuk membaca Kebijakan Privasi ini dengan seksama untuk memastikan bahwa anda memahami bagaimana proses pengolahan data kami.</strong></p>

<p>Kebijakan Privasi ini mencakup hal-hal sebagai berikut:</p>

<ol>
 <li>Informasi Pribadi Yang Kami Kumpulkan.</li>
 <li>Penggunaan Informasi Pribadi Yang Kami Kumpulkan.</li>
 <li>Pemberian Informasi Pribadi Yang Kami Kumpulkan.</li>
 <li>Penyimpanan Informasi Pribadi.</li>
 <li>Akses dan Koreksi Informasi Pribadi.</li>
 <li>Tempat Kami Menyimpan Informasi Pribadi Anda.</li>
 <li>Keamanan Informasi Pribadi Anda.</li>
 <li>Perubahan Atas Kebijakan Privasi Ini.</li>
 <li>Pengakuan dan Persetujuan.</li>
 <li>Materi Pemasaran dan Promosi.</li>
 <li>Data Anonim.</li>
 <li>Platform Pihak Ketiga.</li>
 <li>Cara Menghubungi Kami.</li>
</ol>

<p> </p>

<h6><strong>1.   Informasi Pribadi Yang Kami Kumpulkan.</strong></h6>

<p>Kami mengumpulkan informasi yang mengidentifikasikan dan/atau dapat digunakan untuk mengidentifikasi, menghubungi, dan/atau menemukan orang dan/atau perangkat yang terkait dengan informasi tersebut <strong>("Informasi Pribadi")</strong>. Informasi Pribadi termasuk, tetapi tidak terbatas pada, nama lengkap, tanggal lahir, jenis kelamin, alamat e-mail, identitas berupa nomor induk kependudukan dan/atau nomor induk pegawai (apabila Anda merupakan pegawai negeri sipil Kabupaten Bantul). Kami dapat mengumpulkan informasi dalam berbagai macam bentuk dan tujuan (termasuk tujuan yang diizinkan berdasarkan peraturan perundang-undangan yang berlaku).</p>

<p><strong>Informasi Yang Kami Kumpulkan Dari Anda Dan/Atau Perangkat Seluler Anda Secara Langsung.</strong></p>

<p>Ketika anda mendaftar dan membuat akun dengan kami menggunakan Aplikasi, anda harus memberikan kepada kami Informasi Pribadi tertentu, termasuk nomor induk kependudukan dan alamat e-mail pribadi Anda yang sah.</p>

<p><strong>Informasi Yang Dikumpulkan Setiap Kali Anda Menggunakan Aplikasi Dan/Atau Mengunjungi Situs Web Kami.</strong></p>

<ul>
 <li>Setiap kali anda menggunakan Aplikasi dan/atau mengunjungi situs web kami, kami dapat mengumpulkan data teknis tertentu sehubungan dengan penggunaan anda seperti, alamat protokol internet, informasi halaman web yang sebelumnya atau selanjutnya dilihat, durasi setiap kunjungan/sesi, identitas perangkat internet atau alamat kontrol akses media, dan/atau informasi perangkat lainnya termasuk informasi mengenai produsen, model, dan/atau sistem operasi dari perangkat yang anda gunakan untuk mengakses Aplikasi dan/atau situs web kami.</li>
 <li>Ketika anda menggunakan Aplikasi dan/atau mengunjungi situs web kami, informasi tertentu juga dapat dikumpulkan secara otomatis dengan menggunakan <em>cookies</em>. <em>Cookies</em> adalah berkas data kecil yang tersimpan pada komputer dan/atau perangkat seluler anda. Kami menggunakan <em>cookies</em> untuk melacak aktivitas pengguna dengan tujuan untuk meningkatkan antarmuka dan/atau pengalaman pengguna. Sebagian besar perangkat seluler dan/atau peramban internet mendukung penggunaan <em>cookies</em>, namun anda dapat menyesuaikan pengaturan pada perangkat seluler dan/atau peramban internet anda untuk menolak beberapa jenis <em>cookies</em> dan/atau <em>cookies</em> spesifik tertentu. Perangkat seluler dan/atau peramban anda juga memungkinkan anda untuk menghapus <em>cookies</em> apa pun yang sebelumnya telah tersimpan. Namun demikian, hal itu dapat mempengaruhi fungsi-fungsi yang tersedia pada Aplikasi atau situs web kami.</li>
 <li>Setiap kali anda menggunakan Aplikasi melalui perangkat seluler, kami akan melacak dan mengumpulkan informasi lokasi geografis anda dalam waktu sebenarnya. Dalam beberapa kasus, anda akan diminta atau diharuskan untuk mengaktifkan <em>Global Positioning System</em> (GPS) pada perangkat seluler anda untuk memungkinkan kami agar dapat memberikan anda pengalaman yang lebih baik dalam menggunakan Aplikasi (misalnya untuk menuntukkan arah ke lokasi tertentu). Anda dapat menonaktifkan informasi pelacakan lokasi geografis pada perangkat seluler anda untuk sementara waktu. Namun, hal ini dapat mempengaruhi fungsi-fungsi yang tersedia pada Aplikasi.</li>
</ul>

<p><strong>Informasi Yang Dikumpulkan Dari Pihak Ketiga.</strong></p>

<p>Kami juga dapat mengumpulkan Informasi Pribadi anda dari pihak ketiga (termasuk Pemerintah Pusat/Provinsi/Kabupaten/Kota lain dan/atau pihak lainnya yang memberikan layanan kepada kami, mengumpulkan Data Pribadi dan/atau melakukan tugas atas nama kami, dan/atau dengan siapa kami melakukan kerja sama). Dalam kasus tersebut, kami hanya akan mengumpulkan Informasi Pribadi anda untuk dan/atau sehubungan dengan tujuan yang melibatkan pihak ketiga tersebut dan/atau tujuan kerja sama kami dengan pihak ketiga tersebut (tergantung pada situasinya).</p>

<p><strong>Informasi Tentang Pihak Ketiga Yang Anda Berikan Kepada Kami.</strong></p>

<p>Anda dapat memberikan kepada kami Informasi Pribadi yang berkaitan dengan individu pihak ketiga lainnya (termasuk Informasi Pribadi yang berkaitan dengan pasangan anda, anggota keluarga, teman, dan/atau individu lain). Anda tentu saja akan memerlukan persetujuan dari mereka terlebih dahulu untuk melakukannya - lihat “Pengakuan dan Persetujuan”, di bawah, untuk informasi lebih lanjut.</p>

<h6><strong>2.   Penggunaan Informasi Pribadi Yang Kami Kumpulkan.</strong></h6>

<p>Kami dapat menggunakan Informasi Pribadi yang dikumpulkan untuk tujuan sebagai berikut maupun untuk tujuan lain yang diizinkan oleh peraturan perundang-undangan yang berlaku <strong>("Tujuan")</strong>:</p>

<ol>
 <li>Kami dapat menggunakan Informasi Pribadi anda:
 <ul>
  <li>untuk mengidentifikasi dan mendaftarkan anda sebagai pengguna dan untuk mengadministrasikan, memverifikasi, menonaktifkan, dan/atau mengelola akun anda;</li>
  <li>untuk memfasilitasi atau memungkinkan verifikasi apapun yang menurut pertimbangan kami diperlukan sebelum memberikan layanan kepada anda;</li>
  <li>untuk berkomunikasi dengan anda dan/atau mengirimkan anda informasi sehubungan dengan penggunaan Aplikasi;</li>
  <li>untuk memberitahu anda mengenai segala pembaruan pada Aplikasi dan/atau perubahan pada layanan yang disediakan;</li>
  <li>untuk mengolah dan/atau menanggapi pertanyaan dan saran yang diterima dari anda;</li>
  <li>untuk memelihara, mengembangkan, menguji, meningkatkan, dan/atau mempersonalisasikan Aplikasi dalam rangka memenuhi kebutuhan dan preferensi anda sebagai pengguna; dan</li>
  <li>untuk memantau dan/atau menganalisis aktivitas, perilaku, dan/atau data demografis pengguna termasuk kebiasaan dan/atau penggunaan berbagai layanan yang tersedia di Aplikasi.</li>
 </ul>
 </li>
 <li>Kami juga dapat menggunakan Informasi Pribadi anda secara lebih umum untuk tujuan-tujuan sebagai berikut (walaupun dalam kasus tertentu kami akan bertindak secara wajar dan tidak menggunakan Informasi Pribadi anda lebih dari apa yang diperlukan untuk tujuan tersebut):
 <ul>
  <li>untuk melakukan proses dan/atau fungsi layanan terkait;</li>
  <li>untuk memantau penggunaan Aplikasi dan/atau mengelola, mendukung serta meningkatkan efisiensi kinerja, perkembangan, pengalaman pengguna dan/atau fungsi-fungsi Aplikasi;</li>
  <li>untuk memberikan bantuan sehubungan dengan dan/atau untuk menyelesaikan kesulitan teknis dan/atau masalah operasional dengan Aplikasi dan/atau layanan;</li>
  <li>untuk menghasilkan informasi statistik dan/atau data analitik untuk tujuan pengujian, penelitian, analisis, pengembangan layanan, dan/atau kerja sama;</li>
  <li>untuk mencegah, mendeteksi dan/atau menyelidiki segala kegiatan yang dilarang, ilegal, tidak sah, dan/atau curang; dan</li>
  <li>untuk memungkinkan kami mematuhi semua kewajiban berdasarkan peraturan perundang-undangan yang berlaku, termasuk namun tidak terbatas pada menanggapi permintaan, penyelidikan, dan/atau arahan peraturan, mematuhi persyaratan pengarsipan, pelaporan, dan/atau perizinan yang disyaratkan oleh peraturan yang berlaku) dan/atau melakukan pemeriksaan audit, uji tuntas dan penyelidikan.</li>
 </ul>
 </li>
</ol>

<h6><strong>3.   Pemberian Informasi Pribadi Yang Kami Kumpulkan.</strong></h6>

<ol>
 <li>Kami dapat mengungkapkan atau membagikan Informasi Pribadi anda dengan afiliasi dan pihak lain untuk tujuan sebagai berikut ini serta untuk tujuan lain yang diizinkan oleh peraturan perundang-undangan yang berlaku:
 <ul>
  <li>jika disyaratkan atau diotorisasikan oleh peraturan perundang-undangan yang berlaku (termasuk namun tidak terbatas pada menanggapi pertanyaan terkait regulasi, penyelidikan atau pedoman, dan/atau mematuhi persyaratan atau ketentuan pengarsipan dan/atau pelaporan berdasarkan undang-undang), untuk tujuan yang ditentukan dalam peraturan perundang-undangan yang berlaku;</li>
  <li>jika diinstruksikan, diminta, disyaratkan dan/atau diperbolehkan oleh Pemerintah yang berwenang, untuk tujuan sebagaimana disebutkan dalam kebijakan Pemerintah, peraturan dan/atau peraturan perundang-undangan yang berlaku.</li>
  <li>jika terdapat proses hukum dalam bentuk apapun antara anda dengan kami, atau antara anda dengan pihak lain, sehubungan dengan dan/atau terkait dengan layanan, untuk keperluan proses hukum tersebut;</li>
  <li>sehubungan dengan segala proses verifikasi kami dan/atau pihak ketiga perlukan, sebelum memberikan layanan kepada anda dan/atau kami mendaftarkan anda sebagai pengguna;</li>
  <li>dalam keadaan darurat terkait keselamatan anda, untuk keperluan menangani keadaan darurat tersebut; dan</li>
  <li>dalam situasi terkait kesehatan anda atau kepentingan umum, kami dapat membagikan Informasi Pribadi anda kepada Pemerintah yang berwenang dan/atau institusi lainnya yang dapat ditunjuk oleh Pemerintah yang berwenang dan/atau yang memiliki kerja sama dengan kami, untuk tujuan pelacakan kontak, mendukung inisiatif, kebijakan atau program Pemerintah, kesehatan publik dan/atau tujuan lainnya sebagaimana dibutuhkan secara wajar.</li>
 </ul>
 </li>
 <li>Ketika Informasi Pribadi tidak perlu dikaitkan dengan anda, kami akan melakukan upaya yang wajar untuk menghapus dikaitkannya Informasi Pribadi tersebut dengan anda sebagai individu sebelum mengungkapkan dan/atau berbagi informasi tersebut.</li>
 <li>Kami tidak akan menjual atau menyewakan Informasi Pribadi anda.</li>
 <li>Selain sebagaimana diatur dalam Kebijakan Privasi ini, kami dapat mengungkapkan dan/atau membagikan Informasi Pribadi anda jika kami memberitahu anda dan/atau kami telah memperoleh persetujuan anda untuk pengungkapan atau pembagian tersebut.</li>
</ol>

<h6><strong>4.   Penyimpanan Informasi Pribadi.</strong></h6>

<ol>
 <li>Informasi Pribadi anda hanya akan disimpan selama diperlukan untuk memenuhi tujuan dari pengumpulannya, dan/atau selama penyimpanan tersebut diperlukan dan/atau diperbolehkan oleh peraturan perundang-undangan yang berlaku. Kami akan berhenti menyimpan Informasi Pribadi dan/atau menghapus maksud dari dikaitkannya Informasi Pribadi tersebut dengan anda sebagai individu, segera setelah dianggap bahwa tujuan pengumpulan Informasi Pribadi tersebut tidak lagi dibutuhkan dengan menyimpan Informasi Pribadi dan/atau penyimpanan tidak lagi diperlukan secara hukum.</li>
 <li>Mohon diperhatikan bahwa masih ada kemungkinan bahwa beberapa Informasi Pribadi anda disimpan oleh pihak lain termasuk institusi Pemerintah tertentu. Dalam hal kami membagikan Informasi Pribadi anda kepada institusi Pemerintah yang berwenang dan/atau institusi lainnya yang dapat ditunjuk oleh Pemerintah yang berwenang atau memiliki kerja sama dengan kami, anda menyetujui dan/atau mengakui bahwa penyimpanan Informasi Pribadi anda oleh institusi terkait akan mengikuti kebijakan penyimpanan data masing-masing institusi tersebut. Informasi yang disampaikan melalui komunikasi antara pengguna dengan Pemerintah yang berwenang dan/atau institusi lainnya yang dapat ditunjuk oleh Pemerintah yang berwenang dan/atau yang memiliki kerja sama dengan kami, yang dilakukan selain melalui penggunaan Aplikasi juga dapat disimpan dengan beberapa cara. Kami tidak mengizinkan penyimpanan Informasi Pribadi dengan cara demikian dan kami tidak bertanggung jawab kepada anda untuk hal tersebut. Kami tidak akan bertanggung jawab atas penyimpanan Informasi Pribadi anda. Anda setuju untuk membebaskan kami dari dari tanggung jawab untuk setiap penyimpanan yang tidak sah atas Informasi Pribadi anda.</li>
</ol>

<h6><strong>5.   Akses dan Koreksi Informasi Pribadi.</strong></h6>

<ol>
 <li>Tunduk pada peraturan perundang-undangan yang berlaku, anda dapat meminta kepada kami untuk mengakses dan/atau mengoreksi Informasi Pribadi anda yang berada dalam kepemilikan dan penguasaan kami, dengan menghubungi kami di perincian yang disediakan di bawah ini.</li>
 <li>Kami berhak menolak permintaan anda untuk mengakses, atau untuk memperbaiki, sebagian atau semua Informasi Pribadi anda yang kami miliki atau kuasai jika diizinkan dan/atau diperlukan berdasarkan perundang-undangan yang berlaku. Hal ini termasuk dalam keadaan dimana Informasi Pribadi tersebut dapat berisi referensi kepada orang lain atau dimana permintaan untuk akses dan/atau permintaan untuk mengoreksi adalah untuk alasan yang kami anggap tidak relevan, tidak serius, dan/atau menyulitkan.</li>
</ol>

<h6><strong>6.   Tempat Kami Menyimpan Informasi Pribadi Anda.</strong></h6>

<ol>
 <li>Saat anda menggunakan Aplikasi dan layanan kami di negara lain dimana Aplikasi kami dapat diakses (“Negara Tujuan”), kami dapat mentransfer Informasi Pribadi anda dari negara asal (“Negara Asal”) ke Negara Tujuan untuk membuat anda dapat mengakses dan memastikan pengalaman pelanggan yang lancar ketika Anda menggunakan Aplikasi kami di Negara Tujuan. Dalam hal tersebut, kami akan meminta persetujuan anda untuk mentransfer Data Pribadi anda dari Negara Asal ke Negara Tujuan untuk memastikan kepatuhan atas hukum dan peraturan yang berlaku.</li>
 <li>Kami akan mematuhi seluruh peraturan dan/atau hukum yang berlaku dan/atau menggunakan seluruh usaha yang terbaik untuk memastikan pemberian tingkat perlindungan yang setara dengan komitmen kami dalam Kebijakan Privasi ini.</li>
</ol>

<h6><strong>7.   Keamanan Informasi Pribadi Anda.</strong></h6>

<p>Kerahasiaan Informasi Pribadi anda adalah hal yang terpenting bagi kami. Kami akan memberlakukan upaya terbaik untuk melindungi dan mengamankan data dan/atau Informasi Pribadi anda dari akses, pengumpulan, penggunaan dan/atau pengungkapan oleh orang-orang yang tidak berwenang dan/atau dari pengolahan yang bertentangan dengan hukum, kehilangan yang tidak disengaja, pemusnahan dan kerusakan atau risiko serupa. Namun, pengiriman informasi melalui internet tidak sepenuhnya aman. Walau kami akan berusaha sebaik mungkin untuk melindungi Informasi Pribadi anda, anda mengakui bahwa kami tidak dapat menjamin keutuhan dan keakuratan Informasi Pribadi apa pun yang anda kirimkan melalui Internet dan/atau menjamin bahwa Informasi Pribadi tersebut tidak akan dicegat, diakses, diungkapkan, diubah dan/atau dihancurkan oleh pihak ketiga yang tidak berwenang, karena faktor-faktor diluar kendali kami. Anda bertanggung jawab untuk menjaga kerahasiaan detail Akun anda, termasuk kata sandi anda dengan siapapun dan harus selalu menjaga dan/atau bertanggung jawab atas keamanan perangkat yang anda gunakan.</p>

<h6><strong>8.   Perubahan Atas Kebijakan Privasi Ini.</strong></h6>

<p>Kami dapat meninjau dan mengubah Kebijakan Privasi ini atas kebijakan kami sendiri dari waktu ke waktu, untuk memastikan bahwa Kebijakan Privasi ini konsisten dengan perkembangan kami di masa depan, dan/atau perubahan persyaratan hukum atau peraturan. Jika kami memutuskan untuk mengubah Kebijakan Privasi ini, kami akan memberitahu anda tentang perubahan tersebut melalui pemberitahuan umum yang dipublikasikan pada Aplikasi dan/atau situs web, atau sebaliknya ke alamat e-mail anda yang tercantum dalam Akun anda. Anda setuju bahwa anda bertanggung jawab untuk meninjau Kebijakan Privasi ini secara teratur untuk informasi terbaru tentang pengolahan data dan/atau praktik perlindungan data kami, dan bahwa dengan anda terus menggunakan Aplikasi atau situs web kami, berkomunikasi dengan kami, dan/atau mengakses dan menggunakan layanan setelah adanya perubahan apapun terhadap Kebijakan Privasi ini akan dianggap sebagai persetujuan anda terhadap Kebijakan Privasi ini dan/atau segala perubahannya.</p>

<h6><strong>9.   Pengakuan dan Persetujuan.</strong></h6>

<ol>
 <li>Dengan menyetujui Kebijakan Privasi, anda mengakui bahwa anda telah membaca dan/atau memahami Kebijakan Privasi ini dan/atau menyetujui segala ketentuannya. Secara khusus, anda setuju dan/atau memberikan persetujuan kepada kami untuk mengumpulkan, menggunakan, membagikan, mengungkapkan, menyimpan, mentransfer, dan/atau mengolah Informasi Pribadi anda sesuai dengan Kebijakan Privasi ini.</li>
 <li>Dalam keadaan dimana anda memberikan kepada kami Informasi Pribadi yang berkaitan dengan individu lain (seperti Informasi Pribadi yang berkaitan dengan pasangan anda, anggota keluarga, teman, dan/atau pihak lain), anda menyatakan dan/atau menjamin bahwa anda telah memperoleh persetujuan dari individu tersebut untuk, dan dengan ini menyetujui atas nama individu tersebut untuk, pengumpulan, penggunaan, pengungkapan dan/atau pengolahan Informasi Pribadi mereka oleh kami.</li>
